    data: |
      SELECT DISTINCT - 69 * + 6 - cor0.col1 FROM tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0, tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q2023.out
    data: |
      -424
      -427
      -440
